// Constants
#define MAX_OUTPUT_LEN 1024
#define PTR_WIDTH 8
#define HEX_HEADER 2
#define DEC 10
#define HEX 16

// ASCII Char Codes
#define ZERO_CHAR 48
#define NINE_CHAR 57
#define a_CHAR 97


int num_to_string(char *buf, size_t bufsize, unsigned long val, int base, size_t min_width) {
    int offset = 0;
    char tempBuf[1024]; // Temporary buf before truncation
    if((base == DEC || base == HEX) && bufsize > 0){
        for(int i = 1024 - 1; val != 0; i--){ // Work through 'val' backwards
		int digit = val % base; // 'digit' is last digit of 'val'
		if(digit >= 10) digit += (a_CHAR - 10); // Check if digit is alphabetical (hex)
		else if(digit < 10) digit += ZERO_CHAR; // If alphabetical, offset value
		tempBuf[i] = digit; // Set i index of tempBuf to 'digit'
		val /= base; // Remove last digit of 'val'
		offset++; 
	}
	while(offset < min_width){ // If string isn't greater than or equal to 'min_width'
		offset++;
		tempBuf[1024 - offset] = ZERO_CHAR;
	}
    }else{
	return offset;
    }
    const char *input = &tempBuf[1024 - offset];
    memcpy(buf, input, bufsize); // Set buf to tempBuf
    if(offset >= bufsize) buf[bufsize - 1] = '\0'; // Set last digit to null terminator if 'offset' surpassed 'bufsize'
    else buf[offset] = '\0'; // Set index 'offset' to null terminator
    return offset; 
}

